import { useCallback, useRef} from "react";
import { submitAds } from "../api/api";
import { dataToTransfer } from "../utils/initialSubmitData";
import { useSelector } from "react-redux";
import { useNavigate } from "react-router-dom";
import InputField from "./Common/InputField";
import { properData } from "../utils/date";
import FileInput from "./Common/FileInput";
import { toBase64 } from "../utils/fileConvert";

export default function SubmitAds() {
  const { user_id } = useSelector((state) => state.profile);

  const formData = useRef({
    // accidental: false,
    // insurance: 1,
    // videoUrl:"",
    // picsUrl:'',
    accidental: false,
additionalInfo
: 
"123",
address
: 
"werewr",
brand
: 
"qwe",
carName
: 
"qwe",
city
: 
"werewr",
color
: 
"123qwe",
date
: 
"2024-05-24"
,distance
: 
"123123"
,fuel
: 
"qwe"
,insurance
: 
1
,mobileNum
: 
"123213"
,model
: 
"fsdfd"
,motor
: 
"123"
,picsUrl
: 
"data:image/png;base64,"
,price
: 
"123123"
,status
: 
"qweqwe"
,technicalInfo
: 
"123"
,userId: 1
,videoUrl: ""
,year: "213123"
  });
  const navigate = useNavigate();
  const handleSubmit = async (event) => {
    event.preventDefault();
    const data=properData(formData.current,user_id);
    try {
        console.error(data);
      await submitAds(data);
      navigate('/show-ads')
    
    } catch (error) {
      console.error("Error submitting form:", error);
    }
  };

  const handleChange = useCallback((value, key) => {
    formData.current = {
      ...formData.current,
      [key]: value,
    };
  }, []);

  async function handlePictureChange(Data) {
    const base64=await toBase64(Data)
    formData.current = {
      ...formData.current,
      picsUrl: base64,
    };
  }

  async function handleVideoChange(blobData) {
    formData.current = {
      ...formData.current,
      videoUrl: blobData,
    };
  }

  return (
    
      <div 
      dir="rtl"
      className="w-full"
      // className="bg-[#4C857A] p-6 rounded-lg shadow-lg w-full max-w-lg"
      >
        <form className="space-y-4 flex flex-col w-[60%]" onSubmit={handleSubmit}>
          <h2 className="text-2xl font-bold mb-4 text-white font-dast">ثبت آگهی</h2>
          {dataToTransfer.map((item) =>
            item.type != "h2" ? (
              <InputField
                key={item.name}
                item={item}
                handleChange={handleChange}
              />
            ) : (
              <h2 className="text-2xl font-semibold border-b-2 w-[30%] font-dast" key={item.title}>{item.title}</h2>
            )
          )}
          <div className="text-lg font-semibold text-white">آپلود عکس</div>
          {/* <input
            type="file"
            accept="image/*"
            onChange={handlePictureChange}
            className="w-full mb-4 text-white"
          /> */}
          <FileInput
            type={"img"}
            handleChange={handlePictureChange}
            title={"افزودن تصویر"}
            accept={"image/*"}
          />
          <div className="text-lg font-semibold text-white">آپلود ویدیو</div>
          <FileInput
            type={"video"}
            handleChange={handleVideoChange}
            title={"افزودن ویدیو"}
            accept={"video/*"}
          />
         
          <button
            type="submit"
            className="flex items-center justify-center  bg-[#2B4E47] text-white py-2 px-4 rounded-lg"
          >
            ثبت آگهی
          </button>
        </form>
      </div>
  );
}
